import { useState, useRef, useEffect } from "react";
import Lottie from "lottie-react";
import "../../styles/ApplyToday.css";
import characterAnimation from "../../assets/animations/character.json";

const REQUIRED_FIELDS = [
  "firstName","lastName","ssn","dob","license",
  "address1","city","state","zip",
  "primaryPhone","email","confirmEmail"
];

function ApplyToday() {
  const [form, setForm] = useState({
    firstName: "", middleName: "", lastName: "", suffix: "",
    ssn: "", dob: "", address1: "", address2: "",
    country: "United States", city: "", state: "", zip: "",
    residence3yrs: "", primaryPhone: "", cellPhone: "",
    email: "", confirmEmail: "", consent: false, license: ""
  });

  const [hint, setHint] = useState("üëã Hi! I‚Äôll help you complete this form.");
  const [message, setMessage] = useState("");
  const [completed, setCompleted] = useState(0);

  const lottieRef = useRef();

  /* ===== PROGRESS FEEL ===== */
  useEffect(() => {
    const done = REQUIRED_FIELDS.filter(f => form[f]).length;
    setCompleted(done);
  }, [form]);

  /* ===== SOFT BREATHING LOOP ===== */
  useEffect(() => {
    const idle = setInterval(() => {
      lottieRef.current?.playSegments([0, 15], true);
    }, 5000);
    return () => clearInterval(idle);
  }, []);

  const validateField = (name, value) => {
    if (!value) return "empty";
    if (name === "email") return value.includes("@") ? "good" : "bad";
    if (name === "confirmEmail") return value === form.email ? "good" : "bad";
    if (name === "zip") return value.length >= 5 ? "good" : "bad";
    return "good";
  };

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    const val = type === "checkbox" ? checked : value;

    setForm(prev => ({ ...prev, [name]: val }));

    const state = validateField(name, val);

    /* ===== ASSISTANT EMOTIONS ===== */
    if (state === "good") {
      lottieRef.current?.playSegments([40, 70], true); // excited eyes
      setHint(`‚úÖ Looks good! ${REQUIRED_FIELDS.length - completed - 1} fields left`);
    }

    if (state === "bad") {
      lottieRef.current?.playSegments([90, 120], true); // warning
      setHint(`‚ö†Ô∏è Check your ${name.replace(/([A-Z])/g," $1")}`);
    }

    if (state === "empty") {
      setHint(`‚úèÔ∏è Please enter your ${name.replace(/([A-Z])/g," $1")}`);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (form.email !== form.confirmEmail) {
      lottieRef.current?.playSegments([120, 150], true);
      setMessage("‚ùå Emails do not match");
      setHint("Please fix your email first");
      return;
    }

    if (!form.consent) {
      lottieRef.current?.playSegments([120, 150], true);
      setHint("Please give consent to continue");
      return;
    }

    try {
      lottieRef.current?.playSegments([160, 190], true);
      setHint("üöÄ Submitting your application‚Ä¶");

      await new Promise(r => setTimeout(r, 1500));

      lottieRef.current?.playSegments([200, 240], true);
      setMessage("üéâ Application submitted successfully!");
      setHint("Amazing! You‚Äôre all set üéä");
    } catch {
      setHint("‚ùå Something went wrong");
    }
  };

  return (
    <div className="apply-container">
      <h1>Apply Today ‚Äì Join the RGM Family</h1>

      <div className="progress-pill">
        {completed}/{REQUIRED_FIELDS.length} completed
      </div>

      {/* ASSISTANT */}
      <div className="character-wrapper">
        <Lottie
          animationData={characterAnimation}
          lottieRef={lottieRef}
          loop={false}
          className="character-animation"
        />
        <div className="speech-bubble">{hint}</div>
      </div>

      <form className="apply-form" onSubmit={handleSubmit}>
        {/* YOUR FORM ‚Äî UNCHANGED */}
        {/* keep exactly as you already have */}
        {/* inputs already react via CSS */}
        {/* submit button same */}
      </form>

      {message && <div className="form-message">{message}</div>}
    </div>
  );
}

export default ApplyToday;
